import React from "react";
import BackIcon from "../images/backIcon.png";
import logo from "../images/logo.png";


function salary() {
	return (
		<div>
			<h1 className='create-employee-title'>New Employee</h1>
            <img src={backIcon} className='logo' />
		</div>
	);
}

export default salary;
